import React, { useState } from 'react'

const Contact = () => {
	const [name, setName] = useState();
	const [lastname, setLastName] = useState();
	const [email, setEmail] = useState();

	return (
		<div>
				<form>
					<input 
						type="text" 
						name="name" 
						id="name" 
						placeholder="Nom"
					/>
				</form>
		</div>
	)
}

export default Contact
